  useEffect(() => {
    getData();
  }, []);
  const getData = () => {
    fetch("http://localhost:8000/Register").then((reqs) => {
      reqs.json().then((result) => {
        SetData(result);
        //console.log(result);
      });
    });
  };

  return (
    <div>
      <Header />
      <h1>Home component</h1>
      data :{data.length}
    </div>
  );
}
